import React,{useState,useEffect} from 'react'
import ItemDetail from './ItemDetail'
import {useParams} from 'react-router-dom'

const test = [
  {id:1, price: 250,category:"exterior",titulo:"mesa", image:"data:image/jpeg;base64,"},
  {id:2, price: 50,category:"interior", titulo:"jarron", image:"data:image/jpeg;base64,"},
  {id:3, price: 500,category:"interior",titulo:"ropero", image:"data:image/jpeg;base64,"},
  {id:4, price: 100,category:"exterior",titulo:"silla", image:"data:image/jpeg;base64,"},
];
  
export default function ItemDetailContainer() {

const [data, setData] = useState({});
const {detalleId} = useParams();


useEffect (()=>{
       const getData = new Promise(resolve =>{
      setTimeout(()=>{
        resolve(test);
      },1000)
    });
    getData.then(res => setData(res.filter(test => test.Id === parseInt(detalleId))));
   

  },[])

  return (
   <>
        <ItemDetail data={data} />
        </>
  )
}
